import React from "react";
import "./App.css"
const Btn =()=>{
    const App = () => {
        let date = new Date(); 
        let hh = date.getHours();
        let mm = date.getMinutes(); 
        let ss = date.getSeconds()
 
}

    return (
        <>
        <div className="container">
           <div className="time"> <h1>{hh}:{mm}:{ss}</h1> </div>
           <button className="btn" onClick={Btn}>get time!</button>
        </div>
       
        </>
    )
}
export default App
